import React from "react";

function Button(){
    return (
        <button className="logout-btn">Logout</button>
    );
}

export default function Header(props){
    return (
        <div>
            <div>
                <h1>Chat App</h1>
                {props.username === "" ? <Button /> : null}
            </div>
            <hr />
        </div>
    );
}
